// *********** Begin Option Edit Section ***********
// You can edit the values below to enable/disable functions
// more will be added soon
var b_show_details = true;
var b_auto_inbox_return = false;
var b_hide_gmail_logo = false;
var b_use_tango_icons = true;
var b_hide_copyright = true;
// *********** End Option Edit Section ***********

/* *********** DO NOT EDIT BELOW THIS LINE ***********/

// This is from http://userscripts.org/scripts/show/57495
// Initialise the GMailAPI
GMailAPI({
  // Set the onViewChange handler
  onViewChange: function() {
    // If the viewtype is conversation
    if ( this.viewType === 'cv' ) {
      if (b_show_details) { 
        // Click on all show details links
        var viewElement = this.viewElement,
          links = viewElement.ownerDocument.evaluate( './/span[contains(., "show details")]', viewElement, null, 7, null );
        for ( var i = 0, link; link = links.snapshotItem( i++ ); )
          this.clickElement( link );
      }
      if (b_auto_inbox_return) {
      // Auto return to inbox after reply
      var fn = this;
      this.viewElement.addEventListener( 'DOMNodeInserted', function() {
        if ( fn.viewType !== 'cv' )
          return this.removeEventListener( 'DOMNodeInserted', arguments.callee, false );
        if ( this.ownerDocument.evaluate( ".//table[contains(.,'Your message has been sent') and @role='alert']",this, null, 9, null ).singleNodeValue )
          top.location.hash = '#inbox';
        }, false );
      }
    }
  }
});

